import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // 1. Find and click on a specific product to open its detail view
    const productCard = page.locator('.product-card', { hasText: 'Sony WH-1000XM5 Wireless Noise Canceling Headphones' });
    await productCard.waitFor({ state: 'visible', timeout: 5000 });
    await productCard.click();

    // 2. Wait for the product detail modal to appear
    await page.waitForSelector('#productModal[style*="display: block"]', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // 3. Click the "Add to Wish List" button
    const addToWishlistButton = page.locator('.add-to-wishlist');
    await addToWishlistButton.waitFor({ state: 'visible', timeout: 5000 });
    await addToWishlistButton.click();

    // 4. Wait for the success notification to confirm the action
    await page.waitForSelector('.notification.success:has-text("Added to wishlist!")', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_wishlist_confirmation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_wishlist_confirmation.png'));

    // 5. Extract data from localStorage to verify the item was added
    const wishlistData = await page.evaluate(() => {
      const wishlist = localStorage.getItem('amazonWishlist');
      return wishlist ? JSON.parse(wishlist) : [];
    });

    const addedItem = wishlistData.find(item => item.title.includes('Sony WH-1000XM5'));

    if (!addedItem) {
      throw new Error('Product was not found in the wishlist in localStorage.');
    }

    return {
      success: true,
      action: "Successfully added 'Sony WH-1000XM5' to the wishlist.",
      extractedData: {
        wishlistItem: addedItem,
        wishlistCount: wishlistData.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to add product to wishlist.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
